import { useState } from "react";
import { Card, CardHeader, CardImg } from "react-bootstrap";

function NewsCard({NewsItems}){
    return(
       <>
       {NewsItems.map((artical, index)=> (
           <Card>
            <CardHeader>
                <h5 style={{fontFamily:"inherit"}}>{artical.title}</h5>
            </CardHeader>
            <CardImg variant="top"></CardImg>
          </Card>
        ))}
       </>
    );
}

export default NewsCard;
